import React from "react";
import "./HomePage.scss";

export default function HomePage() {
  return (
    <div>
      {/* <!-- Navigation Bar --> */}
      <nav class="topnav">
        <div class="topnav__header">
          <h2 class="topnav__header-text">Robinhood</h2>
        </div>
        <div class="topnav__list-container">
          <ul class="topnav__list">
            <li class="topnav__list">Products</li>

            <li class="topnav__list">Learn</li>
            <li class="topnav__list">Support</li>
            <li class="topnav__list">Who we are</li>
            <li class="topnav__list">Log In</li>
            <li class="topnav__list">Sign Up</li>
          </ul>
        </div>
      </nav>
      <h1>Hello </h1>
    </div>
  );
}
